import React from "react";
import './App.css';

function Header() {
    return(
        <header>
            <h1 className="logoH1">MY PIZZA™
            <p className="slogon">Безкоштовна доставка</p>
            <img className="logo" src="./logo.png"/></h1>            
            <nav>
               <ul>
                <li>
                    <p>(012) 345-67-89</p>
                    <p>Працюємо з 10:00 до 22:00</p>
                </li>                
                <li><button><img src="./Cart.svg" alt="" />Кошик</button></li>                
               </ul>
            </nav>
        </header>
    )
}

export default Header;
